import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";

import { Route, Link, Switch, BrowserRouter as Router } from "react-router-dom";

// const routing = (
//   <Router>
//     <Route path="/" component={App} />
//   </Router>
// );

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <Route path="/" component={App} />
    </Router>
  </React.StrictMode>,
  document.getElementById("root")
);
